import { Component } from '@angular/core';

@Component({
  selector: 'snippet',
  templateUrl: './snippet.component.html',
  styleUrls: ['./snippet.component.css'],
})
export class SnippetComponent {
  snippets: string;

  constructor() {
    this.snippets = `
  <sidebar-item-section name="Apps">
    <sidebar-item title="All apps" routerLink="/">
      <apps-icon></apps-icon>
    </sidebar-item>
    <sidebar-item title="Updates" routerLink="/admin/updates">
      <updates-icon></updates-icon>
    </sidebar-item>
  </sidebar-item-section>`;
  }
}
<pre
  class="max-w-full overflow-x-auto rounded border bg-gray-100 px-4 py-1 font-mono text-sm text-black"
>
    {{ snippets }}
  </pre
>
